// SPDX-License-Identifier: MIT
pragma solidity 0.8.19;

contract Voting {
    struct Candidate {
        string name;
        uint voteCount;
        bool isActive; // New field to track if candidate is active
    }
    
    address public owner;
    mapping(address => bool) public hasVoted;
    mapping(address => bool) public eligibleVoters;
    mapping(address => uint) public votes;  // Mapping to track each voter's candidate choice
    Candidate[] public candidates;
    bool public electionEnded;
    
    // Constructor to initialize candidates
    constructor(string[] memory candidateNames) {
        owner = msg.sender;
        electionEnded = false;
        for (uint i = 0; i < candidateNames.length; i++) {
            candidates.push(Candidate({
                name: candidateNames[i],
                voteCount: 0,
                isActive: true
            }));
        }
    }
    
    // Modifier to restrict access to only the owner
    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can perform this action.");
        _;
    }
    
    // Modifier to check if the election has ended
    modifier electionActive() {
        require(!electionEnded, "The election has ended.");
        _;
    }
    
    // Function to add a new candidate (only owner can add)
    function addCandidate(string memory candidateName) public onlyOwner {
        candidates.push(Candidate({
            name: candidateName,
            voteCount: 0,
            isActive: true
        }));
    }

 

    // New function to remove a candidate (only owner can remove)
    function removeCandidate(uint candidateIndex) public onlyOwner {
        require(candidateIndex < candidates.length, "Invalid candidate index.");
        require(candidates[candidateIndex].isActive, "Candidate is already removed.");
        candidates[candidateIndex].isActive = false;
    }

    function reactivateCandidate(uint candidateIndex) public onlyOwner {
        require(candidateIndex < candidates.length, "Invalid candidate index.");
        require(!candidates[candidateIndex].isActive, "Candidate is already active.");
        candidates[candidateIndex].isActive = true;
    }
    
    // Function to add an eligible voter (only owner can add)
    function addEligibleVoter(address voter) public onlyOwner {
        eligibleVoters[voter] = true;
    }
    
    // Function to remove an eligible voter (only owner can remove)
    function removeEligibleVoter(address voter) public onlyOwner {
        eligibleVoters[voter] = false;
    }
    
    // Function to end the election (only owner can end)
    function endElection() public onlyOwner {
        electionEnded = true;
    }
    
    // Function to start the election (only owner can start)
    function startElection() public onlyOwner {
        electionEnded = false;
    }
    
    // Modified function to vote for a candidate
    function vote(uint candidateIndex) public electionActive {
        require(!hasVoted[msg.sender], "You have already voted.");
        require(eligibleVoters[msg.sender], "You are not eligible to vote.");
        require(candidateIndex < candidates.length, "Invalid candidate index.");
        require(candidates[candidateIndex].isActive, "This candidate has been removed.");
        
        hasVoted[msg.sender] = true;
        candidates[candidateIndex].voteCount += 1;
        votes[msg.sender] = candidateIndex;
    }
    
    // Modified function to get voting results
    function getResults() public view returns (Candidate[] memory) {
        return candidates;
    }
    
    // Function to check if a specific voter has voted
    function hasVotedStatus(address voter) public view returns (bool) {
        return hasVoted[voter];
    }
    
    // Function to get the candidate index a voter voted for
    function getVoterChoice(address voter) public view returns (uint) {
        require(eligibleVoters[voter], "You are not eligible to vote.");
        require(hasVoted[voter], "This voter has not voted yet.");
        return votes[voter];
    }
}
